create database IF NOT EXISTS indexmessung CHARACTER SET latin1 COLLATE latin1_german1_ci;
use indexmessung;


/* Lege Tabelle bank an */
create table bank(
bankid integer primary key,
bankleitzahl integer,
bezeichnung varchar(120),
plz integer,
ort varchar(120)
);

/*Lege Tabelle bankneu an*/
create table bankneu(
id integer not null primary key auto_increment,
bankid integer,
bankleitzahl integer,
bezeichnung varchar(120),
plz integer,
ort varchar(120)
);


/* Füge 19514 Records in Tabelle bank ein */

SELECT count(*) FROM bank;

